import Layout from "../components/Layout";

export const Content = (props) => (
  <div>
    <h1>{props.url.query.title}</h1>
    <p>This is practice nextJS</p>
  </div>
)

export default (props) => (
  <Layout>
    <h1>{props.url.query.title}</h1>

  </Layout>
)
